import React, { useEffect, useState } from 'react';
import api from '../api/axios';

export default function Upload() {
  const [file, setFile] = useState(null);
  const [result, setResult] = useState(null);
  const [agents, setAgents] = useState([]);
  const [agentLeads, setAgentLeads] = useState({});

  const loadAgents = async () => {
    const res = await api.get('/agents');
    setAgents(res.data);
  };
  const loadLeadsForAgent = async (agentId) => {
    const res = await api.get(`/leads/agent/${agentId}`);
    setAgentLeads(prev => ({ ...prev, [agentId]: res.data }));
  };

  useEffect(() => { loadAgents(); }, []);

  const submit = async (e) => {
    e.preventDefault();
    if (!file) return;
    const form = new FormData();
    form.append('file', file);
    try {
      const res = await api.post('/uploads', form, { headers: { 'Content-Type': 'multipart/form-data' } });
      setResult(res.data);
      res.data.distribution.forEach(d => loadLeadsForAgent(d.agentId));
    } catch (err) {
      alert(err.response?.data?.message || 'Upload failed');
    }
  };

  return (
    <div>
      <h2>Upload CSV/XLSX and Distribute</h2>
      <form onSubmit={submit} style={{ background: 'white', padding: 16, borderRadius: 12, display: 'grid', gap: 8, maxWidth: 520 }}>
        <input type="file" accept=".csv,.xls,.xlsx,.axls" onChange={e => setFile(e.target.files[0])} required />
        <small>Headers required: <code>FirstName, Phone, Notes</code></small>
        <button type="submit" style={{ width: 200, padding: 10, background: '#2563eb', color: 'white', border: 0, borderRadius: 8 }}>Upload</button>
      </form>

      {result && (
        <div style={{ marginTop: 24 }}>
          <div style={{ background: 'white', padding: 16, borderRadius: 12 }}>
            <h3>Distribution Summary</h3>
            <p>Total valid rows: {result.totalValid} | Invalid rows: {result.totalInvalid}</p>
            <ul>
              {result.distribution.map(d => {
                const agent = agents.find(a => a._id === d.agentId);
                return (
                  <li key={d.agentId}>
                    {agent ? agent.name : d.agentId}: {d.count} items
                  </li>
                );
              })}
            </ul>
          </div>

          <div style={{ display: 'grid', gap: 16, gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))', marginTop: 16 }}>
            {result.distribution.map(d => {
              const agent = agents.find(a => a._id === d.agentId);
              const leads = agentLeads[d.agentId] || [];
              return (
                <div key={d.agentId} style={{ background: 'white', padding: 12, borderRadius: 12 }}>
                  <h4>{agent ? agent.name : d.agentId}</h4>
                  <table style={{ width: '100%', borderCollapse: 'collapse' }}>
                    <thead>
                      <tr>
                        <th style={{ textAlign: 'left', padding: 6 }}>First Name</th>
                        <th style={{ textAlign: 'left', padding: 6 }}>Phone</th>
                      </tr>
                    </thead>
                    <tbody>
                      {leads.map(l => (
                        <tr key={l._id} style={{ borderTop: '1px solid #e5e7eb' }}>
                          <td style={{ padding: 6 }}>{l.firstName}</td>
                          <td style={{ padding: 6 }}>{l.phone}</td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              )
            })}
          </div>
        </div>
      )}
    </div>
  );
}
